import React from 'react';
import './App.css';
import Mediacard from './MediaList';

function App() {
  return (
    <div className='App'>
      <section className='App-section'>
        <h2>All cats are beautiful</h2>
        <ul>
          <Mediacard name='Patricia' date='1 de abril' paragraph='hola hola hola' />
          <Mediacard name='Marina' date='1 de abril' paragraph='hola  ' />
          <Mediacard name='Sara' date='1 de abril' paragraph='hola hola' />
        </ul>
      </section>
    </div>
  );
}

export default App;
